package RevisitingConcepts;

public class ValidPalindrome {
    public static void main(String[] args) {
        System.out.println(validPalindrome(""));
    }

    private static boolean validPalindrome(String s) {
        char[] chars = s.toCharArray();
        int lo = 0;
        int hi = chars.length - 1;
        boolean isDeletedFromFront = false;
        boolean isDeletedFromEnd = false;
        int frontDeletionIndex = 0;
        int endDeletionIndex = 0;
        boolean isOneChanged = false;

        while (lo < hi) {
            System.out.println(chars[lo] + " - " + (lo + 1) + " " + chars[hi] + " - " + (hi + 1));
            if (chars[lo] != chars[hi]) {
                if ((isDeletedFromFront || isDeletedFromEnd) && isOneChanged == false) {
                    lo = frontDeletionIndex;
                    hi = endDeletionIndex;
                    isOneChanged = true;
                }

                if (chars[lo + 1] == chars[hi] && isDeletedFromFront == false) {
                    frontDeletionIndex = lo;
                    endDeletionIndex = hi - 1;
                    isDeletedFromFront = true;
                    lo++;
                } else if (chars[lo] == chars[hi-1] && isDeletedFromEnd == false) {
                    frontDeletionIndex = lo + 1;
                    endDeletionIndex = hi;
                    isDeletedFromEnd = true;
                    hi--;
                }

                if (chars[lo] != chars[hi]) {
                    return false;
                }
            }
            lo++;
            hi--;
        }
        return true;
    }
}
